import React from 'react';
import { Link } from 'react-router-dom';

function Header() {
  return (
    <header className="header">
      <nav className="navbar">
        <div className="logo">
          <Link to="/">MyLogo</Link>
        </div>
        <ul className="nav-links">

        </ul>
      </nav>
    </header>
  );
}

export default Header;
